    private DecimalFormat df = new DecimalFormat("0.00");
    private DecimalFormat dfz = new DecimalFormat("#");

    //湿度随机数
    public Double getHumidityValue() {
        return Double.parseDouble(df.format(Math.random() * 100));
    }

    //温度随机数
    public Double getTemperatureValue() {
        return Double.parseDouble(df.format(Math.random() * 120 - 40));
    }

    // 15-30
    public Double getValueSection(String type) {
        if ("temp".equals(type)) {
            return Double.parseDouble(df.format(17.95 + Math.random() * (27.1 - 17.95)));
        } else if ("hum".equals(type)) {
            return Double.parseDouble(dfz.format(39 + Math.random() * (61 - 39)));
        } else if ("tarTemp".equals(type)) {
            return Double.parseDouble(df.format(18 + Math.random() * (20 - 18)));
        } else if ("tarHum".equals(type)) {
            return Double.parseDouble(df.format(40 + Math.random() * (45 - 40)));
        } else if ("air".equals(type)) {
            return Double.parseDouble(df.format(1050 + Math.random() * (2000 - 1050)));
        } else if ("ecPower".equals(type)) {
            return Double.parseDouble(df.format(1700 + Math.random() * (2000 - 1700)));
        } else if ("acPower".equals(type)) {
            return Double.parseDouble(df.format(990 + Math.random() * (1400 - 990)));
        } else {
            return null;
        }
    }

    public String getDate() {
        Date currentTime = new Date();
        SimpleDateFormat formatter = new SimpleDateFormat("yyyy-MM-dd HH:mm:ss");
        return formatter.format(currentTime);
    }

